import React, { useState } from "react";
import "./styles.scss";

import {
  Box,
  Button,
  Hidden,
  Grid,
  List,
  ListItem,
  ImageList,
  ImageListItem,
  Fab,
  Typography,
} from "@material-ui/core";
import SettingsIcon from "@material-ui/icons/Settings";
import HeaderNav from "./HeaderNav";
import SideBar from "./SideBar";

export default function Header() {
  const [toggleSide, setToggleSide] = useState(false);
  const [imageBgr, setImageBgr] = useState(imageBgr[0]);
  const onToggleSide = () => {
    setToggleSide(!toggleSide);
  };

  const changeBgr = (image) => {
    console.log(image);
  };

  return (
    <>
      <Box className={toggleSide ? "side-bar active-side" : "side-bar"}>
        <SideBar />
      </Box>
      <Box className="header-nav">
        <HeaderNav toggleSide={toggleSide} onToggleSide={onToggleSide} />
      </Box>
      <Box className="settings">
        <Button className="button-settings">
          <SettingsIcon className="settings-icons" />
        </Button>
        <Box className="sidebar-filter">
          <Box className="sidebar-filter-color text-center">
            <Typography variant="subtitle2" color="initial">
              SIDEBAR FILTERS
            </Typography>
            <List sx={{ display: "flex", justifyContent: "center" }}>
              <ListItem>
                <span className="change-color badge-purple active-color"></span>
              </ListItem>
              <ListItem>
                <span className="change-color badge-blue"></span>
              </ListItem>
              <ListItem>
                <span className="change-color badge-green"></span>
              </ListItem>
              <ListItem>
                <span className="change-color badge-orange"></span>
              </ListItem>
            </List>
          </Box>
          <Box className="sidebar-filter-image text-center">
            <Typography variant="subtitle2">IMAGES</Typography>
            <ImageList cols={4}>
              {imageBgr.map((item, index) => {
                return (
                  <ImageListItem onClick={() => changeBgr(item)} key={index}>
                    <img srcSet={item} loading="lazy" alt="" />
                  </ImageListItem>
                );
              })}
            </ImageList>
          </Box>
        </Box>
      </Box>
    </>
  );
}

const imageBgr = [
  "https://demos.creative-tim.com/material-dashboard-react/static/media/sidebar-1.0a127c58.jpg",
  "https://demos.creative-tim.com/material-dashboard-react/static/media/sidebar-2.22f68ba5.jpg",
  "https://demos.creative-tim.com/material-dashboard-react/static/media/sidebar-3.e667b13e.jpg",
  "https://demos.creative-tim.com/material-dashboard-react/static/media/sidebar-4.dd4b5581.jpg",
];
